Synopsis
A forbidden attraction between Alec and his son's babysitter, Alison, reaches a breaking point when he confides in her about his impending divorce. Eager to prove that she has what it takes to become a nude model, Megan poses for a worldly photographer. Passions ignite between Cadence and her professor during a meeting to discuss her essay on women's sexual desires. When Dakota agrees to work out only in a sports bra, her personal trainer can no longer resist the temptation of seducing her
